wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(11073844287202371752)
,p_plug_name=>'Requests view'
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(51457439855327568028)
,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select r.ID,',
'       r.REQUEST_TITLE as Title,',
'       r.REQUEST_DESCRIPTION as "Description",',
'        r.DATE_STARTED as "Date of creation",',
'       r.DATE_ENDED as Deadline,',
'       concat(concat(e.first_name, '' ''), e.last_name) as Author,',
'       rt.type_title as Type,',
'       concat(concat(ex.first_name, '' ''), ex.last_name) as Assignee, ',
'     rp.priority_title as Priority,',
'rs.status_title, ',
unistr('case when rs.status_title = ''\041E\0442\043A\0440\044B\0442\043E'' then ''red'''),
unistr('            when rs.status_title = ''\0412\044B\043F\043E\043B\043D\044F\0435\0442\0441\044F'' then ''orange'''),
unistr('            when rs.status_title = ''\0417\0430\043A\0440\044B\0442\043E'' then ''green'''),
'       end Status',
'',
'',
'from REQUEST r join REQUEST_DEPARTMENT rd ON (r.ID = rd.REQUEST_ID) ',
'join EMPLOYEES e on (e.ID = r.EMPLOYEES_ID)',
'left join EMPLOYEES ex on (ex.id = r.executor_employee_id)',
'join REQUEST_TYPE rt on (r.REQUEST_TYPE_ID = rt.ID) ',
'join request_status rs ON (r.Request_status_id = rs.id) ',
'join Request_Priority rp ON (r.Request_Priority_id = rp.id)',
'',
'where rd.DEPARTMENT_ID = :P23_ID'))
,p_plug_source_type=>'NATIVE_IR'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_prn_page_header=>'Requests view'
