'rp.priority_title as Priority,',
'''Close'' as Close,',
unistr('case when rs.status_title = ''\041E\0442\043A\0440\044B\0442\043E'' then ''red'''),
unistr('            when rs.status_title = ''\0412\044B\043F\043E\043B\043D\044F\0435\0442\0441\044F'' then ''orange'''),
