'join EMPLOYEES e on (e.ID = r.EMPLOYEES_ID)',
'left join EMPLOYEES ex on (ex.id = r.executor_employee_id)',
'join REQUEST_TYPE rt on (r.REQUEST_TYPE_ID = rt.ID) ',
'join request_status rs ON (r.Request_status_id = rs.id) ',
